import "./heroimg.css";

import React from 'react'
import desertrainfrog from "../assets/desertrainfrog.jpeg";

const Heroimg = () => {
  return (
    <div className = "hero"> 
        <div className = "mask"> 
            <img className = "into-img" src = "desertrainfrog"/>
        </div>
    </div>
  )
}

export default Heroimg;
